import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Home from './path-to-Home';
import About from './path-to-About';
import Contact from './path-to-Contact';
import Mobile from './path-to-Mobile';
import Fashion from './path-to-Fashion';
import Electronics from './path-to-Electronics';
import Furniture from './path-to-Furniture';
import Appliances from './path-to-Appliances';

function App() {
  return (
    <BrowserRouter>
      <div>
        {/* Your Header and Navbar components can be placed here */}
        {/* They will remain visible throughout the whole app */}
        <Header />
        <Navbar />

        <Switch>
          <Route path="/home" component={Home} />
          <Route path="/about" component={About} />
          <Route path="/contact" component={Contact} />
          <Route path="/mobile" component={Mobile} />
          <Route path="/fashion" component={Fashion} />
          <Route path="/electronics" component={Electronics} />
          <Route path="/furniture" component={Furniture} />
          <Route path="/appliances" component={Appliances} />
          {/* Add more routes as needed */}
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
